import React from "react";
import { useSelector } from "react-redux";
import styles from "./Header.module.css";
import stylemain from "../../index.css";
import classNames from "classnames";

export default function Header() {
  const currentUser = useSelector((state) => state.auth.currentUser);
  const headerClasses = classNames(styles.header, stylemain.item - radius);

  return (
    <div className={headerClasses}>
      <div className={styles.logo}>
        {/* Thêm mã HTML hoặc component cho logo */}
        <h3>Logo</h3>
      </div>

      <div className={styles.menu}>
        {/* Thêm mã HTML hoặc component cho menu */}
        <span className={styles.menuItem}>Menu Item 1</span>
        <span className={styles.menuItem}>Menu Item 2</span>
        {/* Thêm menu items khác tùy vào yêu cầu của bạn */}
      </div>

      <div className={styles.loginLogout}>
        {/* Thêm mã HTML hoặc component cho login/logout */}
        {currentUser && <p>{currentUser.hoTen}</p>}
      </div>
    </div>
  );
}
